import React, { useState, useEffect } from 'react'


let fullURL = "https://rws-cards-api.herokuapp.com/api/v1/"

export default function App() {
  const [cards, updateCards] = useState('')


  useEffect(() => {
    const apiCall = async () => {
      const countries = await axios(fullURL)
      updateCards(cards.data)
    }
    apiCall()
  }, [])


  return (
    <div>
      <h1>hello world</h1>
      {cards.map(card => <h2 key={card.cards}>{card.cards}</h2>)}
    </div>
  )
}
